import React, { Component } from 'react'
import {
    Header,
    Container
} from 'semantic-ui-react';

const Head = ()=>(
    
    <Container text>
         <Header
      as='h1'
      content='Weather'
      inverted
      style={{
        fontSize:'4em',
        fontWeight: 'normal',
        marginBottom: 0,
        marginTop: '1.5em',
      }}
    />
    </Container>
)

export default Head
